const darkTheme = {
  palette: {
    mode: 'dark',
    primary: {
      main: '#34eb46',
    },
  },
};
const lightTheme = {
  palette: {
    type: 'light',
    primary: {
      main: '#34eb46',
    },
  },
};

export {lightTheme};
export {darkTheme};
